import React from "react";
import { Carousel } from "antd";

function ImageSlider(props) {
  return (
    <div>
      <Carousel>
        {props.images.map((image, index) => (
          <div key={index}>
            <img
              style={{ width: "100%", height: "120px" }}
              src={image}
              alt="productImage"
            />
          </div>
        ))}
      </Carousel>
    </div>
  );
}

export default ImageSlider;
